import React, { Fragment } from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import '../styles/Cards.css';


 const Cards = (props) => {
     return(
      <Card className="card">

          <CardMedia
            className="card-media"
            component="img"
            alt="Contemplative Reptile"
            height="480"
            width="300"
            image="https://placeimg.com/640/480/people"
          />

        <CardContent className="card-content">
          <Typography className="title-typo-name" variant="h5" component="h2">
            {props.name}
          </Typography>
          <Typography className="title-typo-desc" variant="h5" component="h2">
            {props.desc}
          </Typography>
           <Typography className="title-typo-skill" variant="body2" color="textSecondary" component="p">
            <b>Skill: &nbsp;</b> {props.skill}
          </Typography> 
        </CardContent>
      </Card>
     )
 } 

export default Cards
